import React, { useState } from 'react'
import Header from '../photos/header.jpg'

const HomeScreen = () => {
    return (
        <div className="container-fluid pl-0 pr-0">
            <img src={Header} className="img-fluid " alt="header" />
        </div>
    )
}
export default HomeScreen
